const commonDenominators=(...e)=>{const r=Array.from(new Set(e.filter(e=>Number.isInteger(e)&&e>0))).sort((e,r)=>e-r);const t=r.length-1;return r.reduce((e,r,t,n)=>{let o=n[0];while(o>0){r%o===0&&n[0]%o===0?e.push(o):null;o--}return e},[]).sort((e,r)=>e-r).filter((e,r,n)=>{return n[r]===n[r+t]})};module.exports=commonDenominators;